            if (option) {
                rcp = rcp | 0x20;
            }

            if (transLimitActive) {
                rcp = rcp | 0x10;
            }

            if (cmvLimitActive) {
                rcp = rcp | 0x08;
            }

            if (floorLimitActive) {
                rcp = rcp | 0x04;
            }

            return [rcp, 0x00];
